aWLI_MixedLifeOrDisabilityProduct.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1036{\fonttbl{\f0\fswiss\fprq2\fcharset0 Calibri;}{\f1\fnil MS Sans Serif;}}
{\colortbl ;\red0\green0\blue0;}
\viewkind4\uc1\pard\sa200\sl276\slmult1\lang1033\f0\fs22 10-year Term Life Insurance is pure term life insurance - the kind that gives you maximum protection for your premium dollar. You are guaranteed the rate you start with for the full ten years you own the policy. Your rate will not go up and your protection will not go down for the full ten years. \par
After the policy expires, you have the option of renewing your insurance for another ten years. This means you can renew your protection every ten years at the renewal rate for our age at the time. Once your policy is in force, you are guaranteed insurable until age 75 when your policy ends - no matter what your health or occupation.\par
Term product can be changed into a whole life product. (In wynsure, resubscribe but waive all eligibility rules.)\par
\par
Mixed product: can be subscribed by an individual or a legal entity.\par
When subscribed by a legal entity means that a key person of the company is insured.\par
\pard\cf1\lang1036\f1\fs16\par
}

